import React from 'react'

const CovidItem = ({maxConfirmed,maxDead,totalRecovered}) => {
    console.log('maxConfirmed', maxConfirmed)
   
    return (
      <>
      <ul className={maxConfirmed} > 
      {maxConfirmed.map(country=>(
          <li key={country.Country}>
             <h2>{country.Country}</h2>
      <p>Total cases:{country.TotalConfirmed}</p>
      <p>New cases:{country.NewConfirmed}</p>



          </li>


      ))}




      </ul>
   
      </>
    );
  };
  export default CovidItem;
